import React from "react";
import { useState, useEffect } from "react";
import axios from "axios";

function Codeforces() {
  const [handle, sethandle] = useState("Amrit_Lal");
  const [users, setusers] = useState({});

  const fetchdetails = () => {
    axios
      .get(`https://api.agify.io?name=michael=${handle}`)
      .then((res) => {
        setusers(res.data.result);
        console.log(res.data);
      })
      .catch((e) => {
        console.log(e);
      });
  };
  return (
    <>
      <input
        type="text"
        placeholder="Enter Your Codeforces Id"
        onChange={(e) => {
          sethandle(e.target.value);
        }}
      />
      <button onClick={fetchdetails}>Find</button>

      <h2>Maximum Rating :{users.maxRating}</h2>
    </>
  );
}

export default Codeforces;
